freq1.codes:
@labeling_function()
def freq1(x):
    import re
    social_words = [r'jesus']
    for word in social_words:
        if re.search(word, x.text.lower()):
            return SOCIAL
    if re.search(r'\+', x.text.lower()) and re.search(r'=', x.text.lower()):
        return SCIENCE
    return ABSTAIN

