@labeling_function()
def rate2(x):
    import re
    if re.search(r'rate', x.text.lower()):
        if re.search(r'electrons', x.text.lower()):
            return SCIENCE
        if re.search(r'pills', x.text.lower()):
            return HEALTH
        if re.search(r'download', x.text.lower()):
            return COMPUTER
    return ABSTAIN
